import React from "react";
import { View, Image, StyleSheet } from "react-native";

function Carousel(props) {
  return (
    <View style={styles.container}>
      <Image source={require("../assets/redline-horizontal.png")} />
      <Image source={require("../assets/clip.png")} style={styles.clip} />
      <Image source={require("../assets/redline-horizontal.png")} />
    </View>
  );
}

const styles = StyleSheet.create({
  carousel: {
    flexDirection: "row",
    width: "80%",
  },

  clip: {
    marginTop: 10,
    // width: "100%",
    height: "auto",
  },

  container: {
    width: "80%",
    justifyContent: "center",
  },
});

export default Carousel;
